	<script>
		function myClick(id) {
			var xhr = new XMLHttpRequest();
			xhr.onload = function() {
				if (xhr.status == 200) {
					var data = xhr.responseText;
					var obj = JSON.parse(data);
					var dom = document.getElementsByTagName('output')[0];
					dom.textContent = obj.pid;
				}
			}
			xhr.open("GET", "../basket1?pid=" + id, true);
			xhr.send();
		}

		function myClickJquery(id) {
			$.getJSON("../sedu/basket1?pid=id" + id, function(jsonDom) {
				$('output').each(function(index, dom) {
					$(dom).text(jsonDom.pid);
				});
			})
		}
	</script>
